import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Navbar from './components/navbar';
import Movies from './pages/movies/mov'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Navbar />
        <div className="pages">
          <Routes>
            <Route path="/" element={<Home />} />
          </Routes>
          <Routes>
            <Route path="/movies" element={<Movies />} />
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
